import "./index.css";
import { Route, Routes} from 'react-router-dom';
import {Container} from 'react-bootstrap';
import RentalForm from './components/RentalForm';
import Header from "./components/Header";


function App() {
  return (
    <div className="App">
      <Header />
  <main >
   <Container>
   <Routes>
        <Route exact path="/" element={<RentalForm />} />
   </Routes>
   </Container>
   </main>
    </div>
  );
}

export default App;
